import React from 'react';
import { motion } from 'framer-motion';

const About = () => {
  const skills = [
    'Machine Learning', 'Deep Learning', 'Python', 'TensorFlow', 'PyTorch',
    'Computer Vision', 'NLP', 'Data Science', 'MLOps', 'Cloud Computing',
    'AI/ML', 'Neural Networks', 'Data Analysis', 'Model Deployment', 'Big Data'
  ];

  return (
    <section id="about" className="min-h-screen py-20 bg-gradient-to-b from-gray-900 to-gray-800 relative overflow-hidden">
      {/* Decorative elements */}
      <div className="absolute inset-0 opacity-10">
        <div className="absolute top-0 left-0 w-full h-full bg-[url('data:image/svg+xml;base64,')]"></div>
      </div>

      <div className="container mx-auto px-4 py-24 relative z-10">
        <motion.div 
          className="glass-card p-8 md:p-12 rounded-3xl max-w-5xl mx-auto bg-gray-800/50 backdrop-blur-lg border border-green-900/30"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
        >
          <div className="mb-12 text-center">
            <h2 className="text-4xl md:text-5xl font-bold mb-4 bg-clip-text text-transparent bg-gradient-to-r from-green-300 to-green-500">
              About Me
            </h2>
            <div className="w-24 h-1 bg-gradient-to-r from-green-400 to-green-600 mx-auto rounded-full"></div>
          </div>

          <div className="prose prose-invert max-w-3xl mx-auto">
            <motion.div 
              className="space-y-6 text-lg leading-relaxed"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.2, duration: 0.6 }}
            >
              <p>
                I'm a passionate <span className="text-green-300 font-medium">Machine Learning Engineer</span> with a strong foundation in developing intelligent systems and scalable AI solutions. My expertise lies in designing and implementing machine learning models that solve complex real-world problems.
              </p>
              <p>
                My journey in AI/ML began with a deep curiosity about how machines can learn and make decisions. This led me to pursue advanced studies in the field, where I've developed expertise in deep learning, computer vision, and natural language processing. I'm particularly fascinated by the intersection of AI and human-computer interaction.
              </p>
              <p>
                With experience in both research and production environments, I've successfully deployed machine learning models that deliver tangible business value. I'm a strong advocate for responsible AI and continuously strive to implement ethical AI practices in my work.
              </p>
            </motion.div>

            {/* Expertise Section */}
            <motion.div 
              className="mt-16 pt-8 border-t border-gray-700"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.4, duration: 0.6 }}
            >
              <h3 className="text-2xl font-semibold text-green-300 mb-6">Areas of Expertise</h3>
              <div className="grid grid-cols-2 md:grid-cols-3 gap-4">
                {['Machine Learning', 'Deep Learning', 'Computer Vision', 'NLP', 'MLOps', 'AI Research'].map((expertise, index) => (
                  <div key={index} className="flex items-center">
                    <span className="w-2 h-2 bg-green-400 rounded-full mr-3"></span>
                    <span className="text-gray-200">{expertise}</span>
                  </div>
                ))}
              </div>
            </motion.div>

            {/* Skills Section */}
            <motion.div 
              className="mt-12 pt-8 border-t border-gray-700"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.6, duration: 0.6 }}
            >
              <h3 className="text-2xl font-semibold text-green-300 mb-6">Technical Skills</h3>
              <div className="flex flex-wrap gap-3">
                {skills.map((skill, index) => (
                  <span 
                    key={index}
                    className="px-4 py-2 bg-gray-700/50 text-gray-200 rounded-full text-sm font-medium border border-gray-600/50 hover:border-green-400/50 transition-colors"
                  >
                    {skill}
                  </span>
                ))}
              </div>
            </motion.div>

            {/* CTA */}
            <motion.div 
              className="mt-12 pt-6 text-center"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.8, duration: 0.6 }}
            >
              <motion.a
                href="#contact"
                className="inline-flex items-center px-8 py-3 bg-gradient-to-r from-green-600 to-green-700 text-white font-medium rounded-lg hover:shadow-lg transition-all duration-300 hover:scale-105 transform"
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.98 }}
              >
                Let's Build Something Amazing
                <svg className="w-5 h-5 ml-2" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M14 5l7 7m0 0l-7 7m7-7H3" />
                </svg>
              </motion.a>
            </motion.div>
          </div>
        </motion.div>
      </div>

      {/* Back to top link */}
      <div className="fixed right-10 top-1/2 transform -translate-y-1/2 rotate-90 origin-right text-sm text-gray-400 hover:text-green-400 transition-colors z-50">
        <a href="#" className="flex items-center group">
          <span className="mr-2 group-hover:mr-3 transition-all">BACK TO TOP</span>
          <span className="text-green-500">â†‘</span>
        </a>
      </div>
    </section>
  );
};

export default About;
